        home.style.zIndex = 1;
        makeAppointment.style.zIndex = 1;
        aboutUs.style.zIndex = 2;
      } 
    })


  return (
    <div className="App">
      <MenuBanner newPageDestinationCall={newPageDestinationCall}/>
      <Home />
      <MakeAppointment />
      <AboutAndContact />
    </div>
  );
}

export default App;
